/// SPDX-License-Identifier:MIT

pragma solidity 0.8.28;


contract Tracking {
    // Struktur data untuk menyimpan informasi pengiriman
    struct Shipment {
        string trackingId; // Nomor resi unik
        string date;       // Tanggal pengiriman
        string status;     // Status pengiriman
        address owner;     // Pemilik data (pengirim)
    }

    // Mapping untuk menyimpan data pengiriman berdasarkan trackingId
    mapping(string => Shipment) private shipments;

    // Event untuk mencatat pengiriman baru
    event ShipmentAdded(string trackingId, string date, string status, address indexed owner);

    // Event untuk mencatat pembaruan status pengiriman
    event ShipmentStatusUpdated(string trackingId, string newStatus);

    // Fungsi untuk menambahkan pengiriman baru
    function addShipment(string memory _trackingId, string memory _date, string memory _status) public {
        // Validasi: Nomor resi harus unik
        require(bytes(shipments[_trackingId].trackingId).length == 0, "Tracking ID already exists");

        // Simpan data pengiriman
        shipments[_trackingId] = Shipment({
            trackingId: _trackingId,
            date: _date,
            status: _status,
            owner: msg.sender
        });

        // Emit event
        emit ShipmentAdded(_trackingId, _date, _status, msg.sender);
    }

    // Fungsi untuk memperbarui status pengiriman
    function updateShipmentStatus(string memory _trackingId, string memory _newStatus) public {
        // Validasi: Nomor resi harus sudah terdaftar
        require(bytes(shipments[_trackingId].trackingId).length != 0, "Tracking ID does not exist");

        // Validasi: Hanya owner yang dapat memperbarui status
        require(shipments[_trackingId].owner == msg.sender, "Only the owner can update the status");

        // Perbarui status pengiriman
        shipments[_trackingId].status = _newStatus;

        // Emit event
        emit ShipmentStatusUpdated(_trackingId, _newStatus);
    }

    // Fungsi untuk mencari data pengiriman berdasarkan nomor resi
    function getShipment(string memory _trackingId) public view returns (string memory, string memory, string memory, address) {
        // Validasi: Nomor resi harus sudah terdaftar
        require(bytes(shipments[_trackingId].trackingId).length != 0, "Tracking ID does not exist");

        Shipment memory shipment = shipments[_trackingId];
        return (shipment.trackingId, shipment.date, shipment.status, shipment.owner);
    }
}

