// SPDX-License-Identifier: MIT

pragma solidity 0.8.28;

contract Tracking {
    struct TrackingInfo {
        uint id;
        string resi;
        string tanggalTransaksi;
        string status; // Pending, Shipping, Delivered
        address owner;
    }

    uint private counter = 0;
    mapping(uint => TrackingInfo) private trackings;

    event TrackingCreated(uint id, string resi, string tanggalTransaksi, string status, address owner);
    event TrackingUpdated(uint id, string status);

    function createTracking(string memory _resi, string memory _tanggalTransaksi, string memory _status) public {
        require(bytes(_status).length > 0, "Status tidak boleh kosong");

        trackings[counter] = TrackingInfo({
            id: counter,
            resi: _resi,
            tanggalTransaksi: _tanggalTransaksi,
            status: _status,
            owner: msg.sender
        });

        emit TrackingCreated(counter, _resi, _tanggalTransaksi, _status, msg.sender);
        counter++;
    }

    function updateTracking(uint _id, string memory _status) public {
        require(trackings[_id].owner == msg.sender, "Hanya owner yang dapat mengupdate");
        require(bytes(_status).length > 0, "Status tidak boleh kosong");

        trackings[_id].status = _status;
        emit TrackingUpdated(_id, _status);
    }

    function getTracking(uint _id) public view returns (TrackingInfo memory) {
        return trackings[_id];
    }

    function getAllTrackings() public view returns (TrackingInfo[] memory) {
        TrackingInfo[] memory allTrackings = new TrackingInfo[](counter);
        for (uint i = 0; i < counter; i++) {
            allTrackings[i] = trackings[i];
        }
        return allTrackings;
    }
}

